window.bookSummaryJSON = "<p>When a time agent lets his historically significant student get killed, Josh is the only agent that can take his place. This event is causing the universe to play fast and loose with physics, allowing the sins of the ONLE time agency to haunt them from the past. Will ONLE survive this attack? Can Josh figure out how resurrection works and get the girl? Will Raj find a curry that doesn't leave him running for the toilet? Join the adventures of Josh and the rest of the ONLE time agency to find out.</p>"; 
